import './MyPage.css';
import Header from '../../components/Header/Header.js';

function MyPage() {
    return (
        <div className='myPage_wrap'>
            <Header />
            <div className='myPage'>
                <div className='myPage_header'></div>
            </div>
        </div>
    )
}

export default MyPage;
